CREATE TABLE virtual_objects (
    object_id UUID PRIMARY KEY,
    object_name VARCHAR(255),
    object_type VARCHAR(50),
    create_date TIMESTAMP
);

CREATE TABLE virtual_objects (
    id UUID PRIMARY KEY,
    object_name VARCHAR(255),
    object_type VARCHAR(50),
    created_at TIMESTAMP
);

CREATE TABLE object_locations (
    location_id UUID PRIMARY KEY,
    object_id UUID REFERENCES virtual_objects(id),
    latitude FLOAT,
    longitude FLOAT
);

CREATE TABLE object_owners (
    owner_id UUID PRIMARY KEY,
    object_id UUID REFERENCES virtual_objects(id),
    owner_name VARCHAR(255),
    owner_email VARCHAR(255)
);

CREATE TABLE object_usage (
    usage_id UUID PRIMARY KEY,
    object_id UUID REFERENCES virtual_objects(id),
    user_id UUID REFERENCES object_owners(owner_id),
    usage_date DATE
);

CREATE TABLE VirtualObjects (
    object_id INT PRIMARY KEY,
    object_name VARCHAR(255),
    object_type VARCHAR(50),
    object_size FLOAT
);

CREATE TABLE UserInventory (
    user_id INT,
    object_id INT,
    quantity INT,
    PRIMARY KEY (user_id, object_id)
);
